#include<bits/stdc++.h>using namespace std;typedef long long ll;int main(){    ll t;    cin>>t;    while(t--){        ll n,m;        cin>>n>>m;        priority_queue<ll> p1;        priority_queue<ll> p2;        for(int i=0;i<n;i++){            ll x;            cin>>x;            p1.push(x);        }        for(int i=0;i<m;i++){            ll x;            cin>>x;            p2.push(x);        }        ll turn=1;        while(!p1.empty()&&!p2.empty()){            if(turn){                ll mx=p1.top();                ll mx1=p2.top();                p2.pop();                if(mx<=mx1)p2.push(mx1-mx);            }            else{                ll mx=p2.top();                ll mx1=p1.top();                p1.pop();                if(mx<=mx1)p1.push(mx1-mx);            }            turn=1-turn;        }        if(p1.empty())cout<<"Bob"<<endl;        else cout<<"Alice"<<endl;    }}